import classes from './MainNavigation.module.css';

import { Link } from 'react-router-dom';

export const MainNavigation = () => {
	return (
		<header>
			<nav>
				<ul>
					<li>
						<Link to="/">Home</Link>
					</li>
					<li>
						<Link to="/products">Products</Link>
					</li>
				</ul>
			</nav>
		</header>
	);
};
